import UIKit

    func lengthOfLongestSubstring(_ s: String) -> Int {
        if s == "" {
            return 0
        }
        if s.count == 1 {
            return 1
        }
        let arrStr: [Character] = Array(s)
        var setVal = Set<Character>()
        var maxValue = 0
        var i = 0
        var pib = 0
        while i < s.count {
            if setVal.contains(arrStr[i]) {
                if setVal.count > maxValue {
                    maxValue = setVal.count
                }
                setVal.removeAll()
                pib += 1
                i = pib
            }
            setVal.insert(arrStr[i])
            i += 1
        }
        return max(maxValue, setVal.count)
    }
    
